import PropTypes from 'prop-types';
import PaginationStyles from './styles/PaginationStyles';

const Pagination = ({ page }) => (
  <PaginationStyles>
    <Head>
      <title>Sick Fits - Page {page} of __</title>
    </Head>
    <Link>Prev</Link>
  </PaginationStyles>
);

Pagination.propTypes = {
  page: PropTypes.any,
};

export default Pagination;
